('KEG006', 'Bantuan Sosial KLB untuk Korban Tanggul Goleng yang Jebol', 'Kudus – Sebuah tanggul yang berada di Dukuh Goleng, Desa Pasuruhan Lor, Kecamatan Jati, Kudus, malam tadi jebol. Jebolnya tanggul tersebut sempat mengakibatkan sejumlah rumah warga terendam.\r\n\r\nAkibatnya puluhan rumah warga di Dusun Goleng, Desa Pasuruan Lor, kebanjiran dan terisolasi bahkan derasnya air turut menggenangi bahu jalan di kawasan Dukuh Karangturi dan Setrokalangan Kaliwungu Kudus.\r\n\r\nKepala BPBD Kudus, Budi Waluyo, mengatakan satu dusun terisolasi karena jalur akses warga terputus tergenang air. Saat ini genangan air masih deras dari arah sungai.\r\n\r\n“Dusun Goleng terisolasi karena masih derasnya air. Terlihat juga menggenangi lahan pertanian,” kata Budi, Sabtu (02/01/2021)..\r\n\r\nMenurutnya, Tanggul yang jebol adalah sepanjang sekitar 25 meter. Air menutupi jalan akses warga Dusun Goleng terputus karena tergenang air. Terlihat juga petugas BPBD Kudus melakukan evakuasi warga dengan menggunakan perahu.\r\n\r\nDilokasi kejadian tanggul jebol, Kades Pasuruan Lor, Nor Badri mengatakan tanggul jebol kurang lebih jam 10.45 WIB malam tadi, Jumat (1/1).\r\n\r\n“Awalnya tanggul itu bocor, namun akhirnya jebol, akibat dari tanggul jebol tersebut Dusun Goleng terisolasi dan puluhan rumah warga terdampak banjir,” kata dia, Sabtu (02/01/2021).\r\n\r\nMenurutnya sejumlah RT yang terdampak adalah RT 01/12 ada 7 rumah, 9 KK, 36 jiwa. Lalu di RT 02 /12 ada 3 rumah, 3 KK, 12 jiwa. Serta di RT 03/12 ada 12 rumah, 14 KK, 76 jiwa. Dengan kedalaman air dari 5 cm sampai dengan 50 cm.\r\n\r\n“Kami juga telah menyediakan dua lokasi pengungsian bagi warga. Nanti sudah disediakan logistik oleh BPBD, ada dapur umum,” sambung Nor.\r\n\r\nMenurutnya, dalam kejadian tersebut tidak ada korban jiwa. Tapi dilaporkan sebuah mobil terseret arus air.\r\n\r\n“Ada satu mobil terseret arus air, tidak ada korban jiwa. Pengemudi selamat dalam kejadian itu,” jelas dia.\r\n\r\nSalah satu warga terdampak, Purnomo, mengatakan saat ini telah dievakuasi petugas BPBD Kudus.\r\n\r\n“Kalau rumah tadi sekitar 10 cm. Cuma ini akses jalan tidak bisa karena tergenang air. Ini mau mengungsi,” jelas Purnomo di lokasi kejadian. (YM/YM)\r\n\r\nSumber: https://isknews.com/tanggul-goleng-jebol-puluhan-rumah-terendam-sebuah-mobil-terseret-banjir/', '2022-06-06', '2022-06-24 00:00:00', '46022fd388722034f002278f39d9e3d1.jpeg', '1', 'bantuan-sosial-klb-untuk-korban-tanggul-goleng-yang-jebol.html'),
